import React, {Fragment} from 'react';

const Listadopokemon = (resultado) => {
    console.log(resultado.resultado.sprites.back_default);
    return ( 
        <Fragment>
            <div>
                <h1>{resultado.resultado.forms[0].name}</h1>
                <img src={`${resultado.resultado.sprites.back_Default}`} alt="Girl in a jacket" />
                <ul>
                    <li>1</li>
                    <li>2</li>
                    <li>1</li>
                    <li>2</li>
                </ul>
            </div>
        </Fragment>
    );
}
 
export default Listadopokemon;
